import React from 'react'
import data from '../channeldata.json';

const ChannelList = () => {

    const channels = data;
    console.log(channels)
    return (<>
        <div>ChannelList</div>
        {channels.map(channel => {
            return <h2>{channel.description}</h2>
        })}
    </>)
}

export default ChannelList
